column8:
★パンチング加工を施したレザーを　センター部分に採用することにより　抜群の通気性を実現！！
<BR><BR>
★快適な座り心地と疲労を和らげる　厚さ10mmの低反発ウレタンスポンジ　を採用！
<BR><BR>
★シート背面には雑誌や地図などが　収納できる便利なポケット付！
<BR><BR>
★背もたれ部・座面部が分割できるセパレート式！
<BR><BR>
●アームレストカバー付！
<BR><BR>

材質：PVC<BR>
適合車種：クオン/フレンズコンドルH23- <BR>
カラー：黒/赤糸<BR><BR>

メーカー名：株式会社ジェットイノウエ
<BR><BR><BR>
