 ＥＶＡ泥除け

◆いすゞ：ＧＩＧＡ（平成６年１１月～平成２７年１０月）専用
<br>
◇仕様◇<br>
木目模様パネルを使用し、<br>ドリンクホルダーと小物入れの枠は、<br>樹脂メッキリングを採用。<br>
純正収納ＢＯＸのフタを外し<br>蝶番を使って取付けるため、<br>収納スペースはそのままご利用いただけます。<br>
◇取付方法◇<br>
運転席左の純正コンソールＢＯＸのフタを外し、<br>
蝶番と止め金具を本製品に移植するだけです。<br><style type="text/css">
<!--
body {
background-image:url(http://image.rakuten.co.jp/utamaroshop/cabinet/tokucyubanpa.jpg);
background-repeat:repeat-y;
background-position: right;
}
-->
</style>

